import {Card, CardBody, CardImg,Row, Col, Container} from 'reactstrap';

class Content extends Component{
	constructor(props) {
		super(props);
		this.state = {}
    }

    componentDidMount(){
        console.log("hola mundo");
    }

	render(){
		const pos = {img:"2", content:"10"}
		return(
			<Card className="product">
				<Row className="separation">
					<Col xs={pos.img} sm={pos.img} md={pos.img} className="h-100 d-table">
						<a href='/' className="d-table-cell align-middle">
							<CardImg src="https://http2.mlstatic.com/reloj-led-colores-D_NQ_NP_851720-MCO31042477337_062019-V.webp"/>
						</a>
					</Col>
					<Col xs={pos.content} sm={pos.content} md={pos.content} className="no-gutter">
						Contenido
					</Col>
				</Row>
			</Card>
		)	
	}
}

export default Content;
